import { useState } from "react";

export default function App() {
  return (
    <div className="container">
      <LoginForm />
    </div>
  );
}

function LoginForm() {
  const [name, setName] = useState("");
  const [cardNumber, setCardNumber] = useState("");

  return (
    <>
      <div className="image-box">
        <HoldersCard name={name} onSetName={setName} />
        <div className="back-card-box"></div>
      </div>
      <div className="form-details-box">
        <CardDetails name={name} onSetName={setName} />
      </div>
    </>
  );
}
function HoldersCard() {
  return (
    <div className="card-box">
      <div className="card-logo-box">
        <svg
          width="84"
          height="47"
          fill="none"
          xmlns="http://www.w3.org/2000/svg"
        >
          <ellipse cx="23.478" cy="23.5" rx="23.478" ry="23.5" fill="#fff" />
          <path
            d="M83.5 23.5c0 5.565-4.507 10.075-10.065 10.075-5.559 0-10.065-4.51-10.065-10.075 0-5.565 4.506-10.075 10.065-10.075 5.558 0 10.065 4.51 10.065 10.075Z"
            stroke="#fff"
          />
        </svg>
      </div>
      <h2 className="card-number">9591 6489 6389 101E</h2>
      <div className="card-detail">
        <strong>Felicia Leire</strong>
        <strong>09/00</strong>
      </div>
    </div>
  );
}

function CardDetails({ name, onSetName }) {
  return (
    <>
      <form className="card-details">
        <div className="form-element">
          <label>Cardholder Name</label>
          <input
            type="text"
            value={name}
            onChange={(e) => onSetName(e.target.value)}
            placeholder="Enter your name"
          />
          <span></span>
        </div>

        <div className="form-element">
          <label>Card Number</label>
          <input type="text" placeholder="e.g. 9591 6489 6389 101E" />
          <span></span>
        </div>

        <div className="form-element form-element--date">
          <div>
            <label>exp. date (MM/YY)</label>
            <div className="exp-date">
              <input type="number" placeholder="MM" />
              <input type="text" placeholder="YY" />
            </div>
            <span></span>
          </div>

          <div>
            <label>cvc</label>
            <input type="text" placeholder="e.g. 123" />
            <span></span>
          </div>
        </div>
        <Button>Confirm</Button>
      </form>
    </>
  );
}

function Button({ children }) {
  return <button className="btn">{children}</button>;
}
